using System;
using System.Collections.Generic;
using System.Linq;
using AutoMapper;
using Domain.Builder;
using Domain.DTO.Order;
using Domain.Repositories;
using Domain.Service;

namespace Service.Services
{
    public class ProductService : IProductService
    {
        private IMapper _mapper;

        public ProductService(IOrderRepository repository, IMapper mapper)
        {
            _mapper = mapper;
        }

        public IEnumerable<ProductDto> GetAll(string type)
        {
            var products = new List<ProductDto>();

            switch (type)
            {
                case "flavors":
                    products.Add(new ProductDto
                    {
                        Name = "banana",
                        Img = ""
                    });

                    products.Add(new ProductDto
                    {
                        Name = "morango",
                        Img = ""
                    });

                    products.Add(new ProductDto
                    {
                        Name = "kiwi",
                        Img = ""
                    });
                    break;

                case "additionals":
                    products.Add(new ProductDto
                    {
                        Name = "paoca",
                        Img = ""
                    });

                    products.Add(new ProductDto
                    {
                        Name = "leite ninho",
                        Img = ""
                    });

                    products.Add(new ProductDto
                    {
                        Name = "granola",
                        Img = ""
                    });

                    break;

                case "sizes":

                    products.Add(new ProductDto
                    {
                        Name = "pequeno",
                        Img = ""
                    });

                    products.Add(new ProductDto
                    {
                        Name = "medio",
                        Img = ""
                    });

                    products.Add(new ProductDto
                    {
                        Name = "grande",
                        Img = ""
                    });

                    break;
            }

            return products;
        }
    }
}